-- ----------------------------
-- Table structure for hiolabs_order
-- ----------------------------
DROP TABLE IF EXISTS `hiolabs_order`;
CREATE TABLE `hiolabs_order` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(20) NOT NULL DEFAULT '',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `order_status` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '101：未付款、102：已取消、103已取消(系统)、201：已付款、202：订单取消，退款中、203：已退款、301：已发货、302：已收货、303：已收货(系统)、401：已完成、801：拼团中,未付款、802：拼团中,已付款',
  `offline_pay` tinyint(1) unsigned DEFAULT '0' COMMENT '线下支付订单标志',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0未发货，1已发货',
  `print_status` tinyint(1) NOT NULL DEFAULT '0',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `consignee` varchar(60) NOT NULL DEFAULT '',
  `country` smallint(5) unsigned NOT NULL DEFAULT '0',
  `province` smallint(5) unsigned NOT NULL DEFAULT '0',
  `city` smallint(5) unsigned NOT NULL DEFAULT '0',
  `district` smallint(5) unsigned NOT NULL DEFAULT '0',
  `address` varchar(255) NOT NULL DEFAULT '',
  `print_info` varchar(255) NOT NULL DEFAULT '',
  `mobile` varchar(60) NOT NULL DEFAULT '',
  `postscript` varchar(255) NOT NULL DEFAULT '',
  `admin_memo` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '免邮的商品的邮费，这个在退款时不能退给客户',
  `pay_name` varchar(120) NOT NULL DEFAULT '',
  `pay_id` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '0',
  `change_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '0没改价，不等于0改过价格，这里记录原始的价格',
  `actual_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实际需要支付的金额',
  `order_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总价',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0',
  `pay_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '付款时间',
  `shipping_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发货时间',
  `confirm_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '确认时间',
  `dealdone_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '成交时间，用户评论或自动好评时间',
  `freight_price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '配送费用',
  `express_value` decimal(10,2) NOT NULL DEFAULT '480.00' COMMENT '顺丰保价金额',
  `remark` varchar(255) NOT NULL DEFAULT '需电联客户请优先派送勿放快递柜',
  `order_type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '订单类型：0普通，1秒杀，2团购，3返现订单,7充值，8会员',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单删除标志',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`user_id`),
  KEY `order_status` (`order_status`),
  KEY `shipping_status` (`shipping_status`),
  KEY `pay_status` (`pay_status`),
  KEY `pay_id` (`pay_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1331 DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of hiolabs_order
-- ----------------------------
BEGIN;
COMMIT;

